sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
   try { 
    var r = new sn_ws.RESTMessageV2('x_1123126_gcx_flag.SAP call', 'Create account in SAP');
     gs.info("this is flow designer for SAP");
     // Instantiate the script include
	var callSap = new CallSapEndpoint();
      var reqPayload = callSap.CreateReqPayload(inputs.account);

     r.setRequestBody(JSON.parse(reqPayload));

    // Execute the REST message

    var response = r.execute();
    var responseBody = response.getBody();
    var httpStatus = response.getStatusCode();
    var responseObject = JSON.parse(response.getBody());
    gs.info(responseBody);
    outputs.reqbody = reqPayload;
	outputs.id = responseObject.id;
    outputs.responsebody = responseObject;
    callSap.InsertSapExternalId(inputs.account.getValue('sys_id'), responseObject.id);
  } catch(ex) {
    var message = ex.message;
  }
})(inputs, outputs);

